import React from 'react';
import styled from 'styled-components';

const Ul = styled.ul<{open: boolean}>`
  z-index: 100;
  list-style: none;
  display: flex;
  flex-flow: row nowrap;
  overflow: scroll;
  overflow-x: hidden;
  li{
    padding: 0.2rem;
    padding-top: .5 rem;
  }
  flex-flow: column nowrap;
  background-color: #e7a72f;
  position: fixed;
  opacity: ${({ open }) => open ? 1 : 0};
  top: 17vh;
  right: 4vw;
  height: 75vh;
  width: 17vw;
  border-radius: 1.1rem;
  transition: all 0.2s linear;
  align-items: 
    li {
      color: #fff;
    }
  
`;

interface RightNavBixoProps {
    open: boolean;
  }

const RightNavBixo = ({ open }: RightNavBixoProps) => {
  return (
    <Ul open={open}>
      <li><a >topico 1</a></li>
      <li><a >topico 2</a></li>
      <li><a >topico 3</a></li>
      <li><a >topico 4</a></li>
      <li><a >topico 5</a></li>
      <li><a >topico 6</a></li>
      <li><a >topico 7</a></li>
      <li><a >topico 8</a></li>
      <li><a >topico 9</a></li>
      <li><a >topico 10</a></li>
      <li><a >topico 11</a></li>
      <li><a >topico 12</a></li>
      <li><a >topico 13</a></li>
      <li><a >topico 14</a></li>
      <li><a >topico 15</a></li>
      <li><a >topico 16</a></li>
      <li><a >topico 17</a></li>
      <li><a >topico 18</a></li>
    </Ul>
  )
}

export default RightNavBixo;
